import { Splide, SplideSlide } from "@splidejs/react-splide";

const Order_Demo = ({ car }) => {
  return (
    <section className="bg-slate-50 fixed w-2/3 top-20 orderSlider">
      <Splide
        aria-label="Power Train"
        options={{
          type: "fade",
          rewind: true,
          autoplay: true,
          arrows: true,
          arrowsPath:
            "M11.354 1.646a.5.5 0 0 1 0 .708L5.707 8l5.647 5.646a.5.5 0 0 1-.708.708l-6-6a.5.5 0 0 1 0-.708l6-6a.5.5 0 0 1 .708 0",
          pagination: false,
        }}
      >
        {car.order.demo.map((item, index) => {
          return (
            <SplideSlide>
              <img src={item} alt={index} className="bg-fullobject h-[90vh]" />
            </SplideSlide>
          );
        })}
      </Splide>
    </section>
  );
};

export default Order_Demo;
